import React from "react";
import Fullpage, {
  FullPageSections,
  FullpageNavigation,
  FullpageSection,
} from "@ap.cx/react-fullpage";
import html5 from "../../img/html5.png";
import css from "../../img/css.png";
import js from "../../img/js.png";
import react from "../../img/react.png";

const HomeConts3 = () => {
  // 이미지와 텍스트를 연결하는 데이터 배열
  const stackData = [
    {
      imageUrl: html5,
      title: "HTML5",
      subtext:
        "웹접근성, 표준성을 준수하며 시멘틱태그를 이용해 마크업 할 수 있습니다.",
    },
    { imageUrl: css, title: "CSS" },
    { imageUrl: js, title: "JavaScript" },
    { imageUrl: react, title: "React" },
  ];

  return (
    <FullpageSection>
      <div className="homeWrapper3">
        <h1 className="title">
          MY <span>SKILLS</span>
        </h1>
        <ul className="stacksList">
          {stackData.map((data, index) => (
            <li key={index}>
              <img src={data.imageUrl} alt={data.title} />
              {data.title}
              <p>{data.subtext}</p>
            </li>
          ))}
        </ul>
      </div>
    </FullpageSection>
  );
};

export default HomeConts3;
